import React from 'react';

const Profile = () => {
    return(
        <div className='content'>
          <div className='cover'>
              <img src='https://i.pinimg.com/564x/0a/9b/0f/0a9b0f4466e573f7b131658e79e606eb.jpg' alt='cover p'></img>
          </div>
          <div>
              ava + description
          </div>
          <div>
              My posts
              <div>
                  New post
              </div>
          </div>
      </div>
    )
};

export default Profile;
